export interface Post {
    id: number;
    title: string;
    location: string;
    participants: string;
    date: string;
    time: string;
    views: number;
    description: string;
    content: string;

    lat: number;
    lng: number;
}

export const EmptyPost : Post = {
    id: 0,
    title: '',
    location: '',
    participants: '',
    date: '',
    time: '',
    views: 0,
    description: '',
    content: '',
    lat: 0,
    lng: 0
}
